import React from 'react'

const Intro3 = () => {
  return (
    <div>자주 오는 마트이니만큼 이미 알고 계시겠지만, 마트의 내부 구조는 위와 같습니다. 
    실험이 시작되면 당신은 마트를 

    1. 웹페이지 화면을 넘겨가면서 첫 섹션부터 끝 섹션까지 차례대로 둘러보실 수 있고, 
    2. 특정 섹션으로 바로 가시려면 위에 첨부된 마트 지도에서 각 섹션을 클릭하여 해당 섹션으로 이동할 수 있습니다.

    이 마트에는 과일, 채소, 계란 및 유제품, 정육점, 해산물, 가공식품, 냉동식품, 과자류 및 라면, 디저트 및 주류의 10개의 섹션이 있습니다.</div>
  )
}

export default Intro3
